import './App.css';
import * as player from './player.js';
import Form from "./render_form";
//use tailwind styles
function App() {
  return (
    <div className="App">
        <h1>Конфигуратор headless_autoplay</h1>
        <form>
            <Form object={player}/>
        </form>

    </div>

  );
}
window.player = player;
export default App;
